import React from 'react'
import { Carousel, Image } from 'react-bootstrap'
import { data } from './data'

const NewsCarousel = () => {
  return (
    <Carousel fade>
         {data.articles.map((topnews) => (
                <Col sm={6} md={6} lg={6} xl={4}>
                <NewsCard topnews={topnews} />
              </Col>
            ))}
    </Carousel>
  )
}

export default NewsCarousel
